import React from "react";
import Home from "./home/Home"
import List from "./list/List"
import {BrowserRoute,Routes,Route,} from "react-router-dom";
function App() {
  return (
    <BrowserRoute>
      <Routes>
        <Route path="/" element={<Home />}></Route>
      </Routes>
    </BrowserRoute>
  );
}

export default App;
